		public MainWindow()
		{
			InitializeComponent();

			VRageMath.Vector3D gravity = new VRageMath.Vector3D(5.98196840286255, 3.45129823684692, 6.967116355896);

			x = -gravity.X;
			y = -gravity.Y;
			z = -gravity.Z;

			/*x = 0;
			y = 0;
			z = 1;*/

			XBox.Text = x.ToString();
			YBox.Text = y.ToString();
			ZBox.Text = z.ToString();

			mapDisplay_ = new MapDisplay();
			mapDisplay_.View3D = Viewport3D;
			mapDisplay_.View2D = Canvas2D;

			nodeMap_ = new Dictionary<Ellipse, Program.MovementPlanner.MovementNode>();

			pointsToAdd = new List<VRageMath.Vector3D>();

			PreparePoints();

			MainProcess();

			var groundPlane = new VRageMath.PlaneD(mapDisplay_.MapManager.CurrentLocation, mapDisplay_.MapManager.UpDirection);
			var referenceCenter = new VRageMath.Vector3D(mapDisplay_.MapManager.TerrainMap.Center);
			var projectedCenter = groundPlane.ProjectPoint(ref referenceCenter);
			var projectedCenterX = (projectedCenter - mapDisplay_.MapManager.CurrentLocation).Dot(mapDisplay_.MapManager.X_Axis);
			var projectedCenterY = (projectedCenter - mapDisplay_.MapManager.CurrentLocation).Dot(mapDisplay_.MapManager.Y_Axis);

			baseNode_ = new Program.MovementPlanner.MovementNode(new VRageMath.Vector2D(projectedCenterX, projectedCenterY), 0, 0, mapDisplay_.Center2D, 0);

			selectedNode_ = baseNode_;

			//DrawTerrainMapLines();
			DrawMovementPlanner();
		}

		void ClearDrawings()
		{
			Viewport3D.Children.Clear();
			Canvas2D.Children.Clear();
		}

		void MainProcess()
		{
			var lowSide = new VRageMath.Vector3D(pointsToAdd.First().X, pointsToAdd.First().Y, pointsToAdd.First().Z);
			var highSide = new VRageMath.Vector3D(pointsToAdd.First().X, pointsToAdd.First().Y, pointsToAdd.First().Z);

			foreach (var point in pointsToAdd)
			{
				if (point.X < lowSide.X)
				{
					lowSide.X = point.X;
				}
				else if (point.X > highSide.X)
				{
					highSide.X = point.X;
				}

				if (point.Y < lowSide.Y)
				{
					lowSide.Y = point.Y;
				}
				else if (point.Y > highSide.Y)
				{
					highSide.Y = point.Y;
				}

				if (point.Z < lowSide.Z)
				{
					lowSide.Z = point.Z;
				}
				else if (point.Z > highSide.Z)
				{
					highSide.Z = point.Z;
				}
			}

			var centerPoint = (highSide - lowSide) / 2 + lowSide;
			var maxDistance = VRageMath.Vector3D.Distance(highSide, lowSide);
			var extents = new VRageMath.Vector3D(maxDistance, maxDistance, maxDistance);

			mapDisplay_.MapManager.TerrainMap = new Program.TerrainMap(centerPoint, extents);
			mapDisplay_.MapManager.CurrentLocation = new VRageMath.Vector3D(-37320.6732347511, -21531.9595464244, -43466.9570537088);
			mapDisplay_.MapManager.UpDirection = VRageMath.Vector3D.Normalize(new VRageMath.Vector3D(x, y, z));
			mapDisplay_.MapManager.SetX_Direction(new VRageMath.Vector3D(-0.270637720823288, -0.749635398387909, 0.603988409042358));
			mapDisplay_.MapManager.SetY_Direction(new VRageMath.Vector3D(0.729417383670807, -0.56912887096405, -0.379529297351837));
			mapDisplay_.MapManager.GenerateMovementPlanner();

			foreach (var pointToAdd in pointsToAdd)
			{
				mapDisplay_.MapManager.AddPoint(pointToAdd, 1);
			}

			mapDisplay_.ResetCenter2D();

			//var lights = new DefaultLights();

			//Viewport3D.Children.Add(lights);

			//DrawTerrainMapPoints();
		}

		void DrawTerrainMapLines()
		{
			var points = mapDisplay_.MapManager.TerrainMap.GetPoints();

			var connectPoints = new HashSet<Tuple<int, int>>();

			var collider = new Program.TerrainMap.SphereCollider(new VRageMath.Vector3D(0, 0, 0), 1);

			for (int i = 0; i < points.Count(); i++)
			{
				var point = points[i];

				collider.Position = point;
				var nearbyPoints = mapDisplay_.MapManager.TerrainMap.GetCollisions(collider);

				foreach (var nearPoint in nearbyPoints)
				{
					int otherIndex = points.FindIndex(
						delegate (VRageMath.Vector3D v)
						{
							return (nearPoint.Position.X == v.X && nearPoint.Position.Y == v.Y && nearPoint.Position.Z == v.Z);
						});

					if (i != otherIndex)
					{
						Tuple<int, int> newTuple;

						if (i < otherIndex)
						{
							newTuple = new Tuple<int, int>(i, otherIndex);
						}
						else
						{
							newTuple = new Tuple<int, int>(otherIndex, i);
						}

						connectPoints.Add(newTuple);
					}
				}
			}

			foreach (var link in connectPoints)
			{
				var p1 = points[link.Item1];
				var p2 = points[link.Item2];

				// Add to visual display
				var pointLine = new HelixToolkit.Wpf.LinesVisual3D();
				pointLine.Points.Add(new Point3D(p1.X, p1.Y, p1.Z));
				pointLine.Points.Add(new Point3D(p2.X, p2.Y, p2.Z));
				Viewport3D.Children.Add(pointLine);
			}
		}

		void DrawTerrainMapPoints()
		{
			foreach (var point in mapDisplay_.MapManager.TerrainMap.GetPoints())
			{
				var tempPointBody = new HelixToolkit.Wpf.SphereVisual3D();
				tempPointBody.Center = new Point3D(point.X, point.Y, point.Z);
				tempPointBody.Radius = 0.1;
				Viewport3D.Children.Add(tempPointBody);
			}
		}

		void DrawMovementPlanner()
		{
			mapDisplay_.Clear2D();
			nodeMap_.Clear();

			mapDisplay_.Center2D = selectedNode_.Position;
			DrawPointsAroundSelectedNode();

			DrawNode(baseNode_);
		}

		void DrawNode(Program.MovementPlanner.MovementNode node)
		{
			var circle = mapDisplay_.DrawMovementNode(node);
			circle.MouseLeftButtonDown += Node_Click;
			nodeMap_.Add(circle, node);

			foreach (var child in node.Children)
			{
				DrawNode(child);
			}
		}

		void DrawPointsAroundSelectedNode()
		{
			var collider = new Program.MovementPlanner.CircleCollider(selectedNode_.Position, double.Parse(RadiusBox.Text));

			mapDisplay_.DrawColliding2D_Points(collider);
		}

		public void Node_Click(object sender, RoutedEventArgs e)
		{
			selectedNode_ = nodeMap_[(Ellipse)sender];
			mapDisplay_.Center2D = selectedNode_.Position;
			DrawMovementPlanner();
		}

		private void Button_Click(object sender, RoutedEventArgs e)
		{
			x = double.Parse(XBox.Text);
			y = double.Parse(YBox.Text);
			z = double.Parse(ZBox.Text);

			ClearDrawings();

			MainProcess();

			DrawMovementPlanner();
		}

		private void ZoomButton_Click(object sender, RoutedEventArgs e)
		{
			mapDisplay_.Zoom2D = double.Parse(ZoomBox.Text);

			mapDisplay_.Clear2D();
			DrawMovementPlanner();
		}

		private void RadiusButton_Click(object sender, RoutedEventArgs e)
		{
			DrawMovementPlanner();
		}

		private void NodeChildrenButton_Click(object sender, RoutedEventArgs e)
		{
			selectedNode_.DebugSetAngle(double.Parse(NodeAngleBox.Text));
			mapDisplay_.MapManager.MovementPlanner.CreateChildren(selectedNode_);
			DrawNode(selectedNode_);
		}

